"help_video_description" : "Отображение изображения камер на Международной космической станции в режиме реального времени. Вы можете смотреть в полноэкранном режиме изображение камер и делиться на странице вашей любимой социальной сети или в другом месте. Видео имеет следующие параметры: 

• Камера 1 (HD): набор камер в формате высокой четкости, установлен на внешней стороне МКС; 

• Камера 2: набор камер, установленных снаружи и внутри МКС. Иногда можно наблюдать за работой космонавтов на борту и смотреть интервью прямо из космоса; 

• NASA TV и NASA TV Media: Отображает программы по миссии НАСА, исследовательские вопросы, связанные с пространством."
